import ImageBlock from './ImageBlock'

const FooterSectionThree = () => {
  return (
    <div>
      <ImageBlock
      blockStyles='bg-gradient-to-l from-red-500 to bg-purple-600 rounded-lg shadow-2xl h-96 px-20'
